,'new','44230489','90728737',3,'company','1423126288000','1423186606000'),(39,'test approval 2','111','normal',NULL,'new','95973093','40882969',3,'company','1423128357000','1423189149000'),(40,'b','b','normal',NULL,'new','44230489','53741244',3,'company','1423186900000','1423192564000'),(41,'approval title','approval desx','normal','1423180800318','new','01109597','95973093',3,'company','1423208673000','1423208673000'),(42,'9','9','normal','1423238340000','cancelled','44230489','95973093',3,'company','1423209363000','1423278456000'),(43,'willw approval','willw desc','normal','1423209664998','approved','82183064','82183064',32,'company','1423209712000','1423277396000'),(44,'测试load history','hdhhs','normal','1423213935039','approved','82183064','82183064',32,'company','1423213967000','1423277416000'),(45,'t','t','normal','1423324740000','cancelled','44230489','53741244',3,'company','1423278400000','1423278493000'),(46,'S','I','normal',NULL,'new','68612089','82183064',36,'company','1423278739000','1423278739000'),(47,'1','1','normal','1423324740000','new','44230489','90728737',3,'company','1423279496000','1423279496000'),(48,'5','5','normal','1423324740000','new','44230489','60568968',3,'company','1423280958000','1423280958000'),(49,'d','d','normal',NULL,'new','44230489','95973093',3,'company','1423281153000','1423281153000'),(50,'create aapproval','hdhsh','normal','1423289528729','new','47986702','47986702',32,'company','1423289558000','1423289574000'),(51,'給 Apple CEO Tim Cook 發了一封郵件之後⋯⋯','感覺還是蠻有用的！\n\n大概半年前 MacBook Pro 因為硬件缺陷送至 Genius Bar 維修更換了一大批配件之後現在又出現了完全一樣的問題：電池膨脹、health 嚴重降低、經常無法充電、強行重啓等等。懷疑有什麼硬件缺陷，無奈之下突然想到給 Apple CEO office 發郵件吐槽。\n\n接著大概三天後收到三里屯 Genius Bar 主管的回覆，先是郵件說嘗試電話聯繫未能接通（被我當騷擾電話 mute 了 =_=），然後接到了北京打過來的電話，一個主管加兩個技術顧問，還是 E 文的，開口就「Hello, Mr. Hunter」。不過了解到我當前的情況後他們很快幫我轉接到了上海這邊的 Apple Store 並做了次日下午的預約。\n\n明天下午去 Apple Store 看看，回來再更新進展。','normal',NULL,'','03721515','12014772',33,'company','1423298904000','1423448853000'),(52,'U','U','normal',NULL,'cancelled','43701535','36805949',33,'company','1423304464000','1423539497000'),(53,'test 1','11111','normal',NULL,'new','95973093','53741244',3,'company','1423381580000','1423381580000'),(54,'test 2','111','normal',NULL,'new','95973093','01109597',3,'company','1423382626000','1423382626000'),(55,'Qq','Ll','high','1423670340000','cancelled','43701535','12014772',33,'company','1423448697000','1423448865000'),(56,'你好吗','我很好','low','1425139140000','new','77537560','86304681',33,'company','1423463389000','1423463389000'),(57,'鼠標','我第一次见到 Mac 是在2001年，那时候洪恩有一个做音乐的流浪歌手，名为老郭，头发蓬乱，夹克坚硬，伊常常在午后橙色的阳光里，怀抱着吉他，安详的坐在 Mac Pro 前调音和谱曲。我清晰的记得，那个版本的 OS X 是 10.2 Jaguar，充满科技感的金属拉丝界面让我们这些用惯了 Windows 和 Linux 的程序猿眼中充满了攫取的目光。奇怪的是，伊使用的鼠标没有像普通 PC 鼠标那样前半部分叉，而是一个浑然一体的半圆形，这一点让我们浮想联翩。\n\n我凑过去问，「这玩意是鼠标么？为什么没键？」','normal','1423843140000','new','03721515','38400507',33,'company','1423463882000','1423463882000'),(58,'forwald','jdjsj','normal','1423472046359','new','82183064','82183064',41,'company','1423472082000','1423472124000');
